import React from "react";
import { FcDoughnutChart } from "react-icons/fc";

const Dashboard = () => {
  return (
    <div>
      <div className="m-2 box-border border-4 bg-gray-200  rounded-xl">
        <div className="flex">
          <h1 className="text-3xl my-1 p-2">
            <FcDoughnutChart />
          </h1>
          <h1 className=" text-gray-700 my-1 text-xl md:text-2xl p-2">
            Dashboard:
          </h1>
        </div>
      </div>
      <div
        className="bg-gray-200 m-2 rounded-2xl
       h-screen p-2"
      >
        <h1 className="text-gray-700 text-base m-2 px-2 py-1 bg-green-300 rounded-xl">
          Student Profile
        </h1>
      </div>
    </div>
  );
};

export default Dashboard;
